<script>
    let leafletMap;
    const mapFinder = setInterval(() => {
        for (const key in window) {
            if (key.startsWith("map_") && window[key] instanceof L.Map) {
                leafletMap = window[key];
                console.log("✅ Found Leaflet map:", key);
                clearInterval(mapFinder);

                // Find GeoJSON layer
                let hexLayer = null;
                leafletMap.eachLayer(layer => {
                    if (layer instanceof L.GeoJSON) {
                        hexLayer = layer;
                        console.log("✅ Found GeoJSON layer with", Object.keys(layer._layers).length, "features");
                    }
                });

                if (!hexLayer) {
                    console.error("❌ No GeoJSON layer found.");
                    return;
                }

                // Attach message listener
                window.addEventListener("message", (event) => {
                    console.log("📩 map.html received:", event.data);
                    if (!event.data || !event.data.type) return;

                    if (event.data.type === "requestAmenities") {
                        const amenitySet = new Set();
                        hexLayer.eachLayer(layer => {
                            const featureAmenities = (layer.feature?.properties?.amenities || []);
                            featureAmenities.forEach(a => amenitySet.add(String(a)));
                        });
                        const amenities = Array.from(amenitySet).sort();
                        try {
                            (event.source || window.parent).postMessage({ type: "amenityList", amenities }, "*");
                            console.log("📤 Sent amenityList (", amenities.length, ") to parent.");
                        } catch (e) {
                            console.error("❌ Failed to send amenityList", e);
                        }
                    }

                    if (event.data.type === "highlightAmenities") {
                        const activeAmenities = new Set((event.data.amenities || []).map(String));
                        let matched = 0;
                        hexLayer.eachLayer(layer => {
                            const featureAmenities = (layer.feature?.properties?.amenities || []).map(String);
                            const hasMatch = featureAmenities.some(a => activeAmenities.has(a));
                            if (hasMatch) {
                                layer.setStyle({ fillColor: "blue", fillOpacity: 0.9, weight: 2 });
                                matched++;
                            } else {
                                layer.setStyle({ fillOpacity: 0.1, weight: 0.3, color: "#444444" });
                            }
                        });
                        console.log("🔵 Highlighted", matched, "cells for amenities.");
                    }

                    if (event.data.type === "clearHighlight") {
                        hexLayer.resetStyle();
                        console.log("🧹 Cleared highlight.");
                    }
                });

                console.log("🎉 Message listener attached.");
                break;
            }
        }
    }, 100);
</script>
